package bookPoo;
import java.text.*;;
public class Ejerciciocuatro {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int iteracion;
		int base = 5;
		int espo = 7;
		int resul=1;

		for (iteracion = 1; iteracion <= espo; iteracion++) {
			
			resul = resul * base;

			System.out.println(resul);
		}

	}

}
